function cavasButtonDownLoadInit() {
    manifest = [{
        src: "/images/btn-download.png",
        id: "btn_dowload"
    }, ];
    preload = new createjs.LoadQueue;
    preload.addEventListener("complete", handleComplete);
    preload.loadManifest(manifest, !0, linkImg)
}
function fitToContainer(n) {
    n.style.width = "100%";
    n.style.height = "100%";
    n.width = n.offsetWidth;
    n.height = n.offsetHeight
}
function handleComplete() {
    function u(n) {
        t.update(n)
    }
    function f() {
        window.open(download_link, "_self")
    }
    var t = new createjs.Stage("canvasButtonDownLoad"), r = document.querySelector("canvas"), i, n;
    fitToContainer(r);
    t.enableMouseOver();
    i = new createjs.SpriteSheet({
        framerate: 60,
        images: [preload.getResult("btn_dowload")],
        frames: {
            width: 498,
            height: 403,
            count: 28
        },
        animations: {
            run: [0, 27, "run", .2]
        }
    });
    n = new createjs.Sprite(i,"run");
    n.x = 0;
    n.y = 0;
    n.cursor = "pointer";
    $.when(t.addChild(n)).done(function() {
        setTimeout(function() {
            $(".btn-download").css("background", "unset")
        }, 450)
    });
    createjs.Ticker.getMeasuredFPS(60);
    createjs.Ticker.on("tick", u);
    n.addEventListener("click", f)
}
var linkImg, preload;
$(document).ready(function() {
    $("#toggle-close").click(function() {
        var n = $(".fixed-right-button");
        n.animate({
            right: "-200px"
        }, "slow");
        $("#toggle-open").animate({
            right: "0"
        }, "slow")
    });
    $("#toggle-open").click(function() {
        var n = $(".fixed-right-button");
        n.animate({
            right: "0"
        }, "slow");
        $("#toggle-open").animate({
            right: "-200px"
        }, "slow")
    });
});
linkImg = window.location.origin + test_link + "/Site/css/images/btn/";
$(document).ready(function() {
    cavasButtonDownLoadInit()
});
